import Foto from "../image/Foto.jpg";
import '../App.css';

import { Grid, Cell  } from "rect-mdl";


class AboutMe extends Component {
    render() {
        return (
            <div>

                <Grid>
                    <Cell col={4}>
LEFT SIDE
                    </Cell>
                    <Cell  col={8}>
RIGHT SIDE
                    </Cell>

                </Grid>
            </div>
        );
    }
}

export default AboutMe;
